import styled from "styled-components";


export const StyledNav = styled.nav`
    background: black;
    color: blue;
    height: 30px;
    margin-top: -30px;
    display: flex;
    justify-content: right;
    align-items: c;
    font-size: 1px;
    position: sticky;
    top: 0;
    z-index: 10;
    padding: 15px;
    
`
export const StyledNavLogo = styled.nav`
    background: black;
    color: red;
    height: 85px;
